import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import VoiceTracking from '../components/VoiceTracking';

const VoiceTrackingPage = () => {
  return (
    <>
      <Header />
      <VoiceTracking />
      <Footer />
    </>
  );
};

export default VoiceTrackingPage;
